import AdNav from "./admin/AdNav";

function App() {
  return (
    <div>
      {/* <Router>
        <Navigator />
      </Router> */}
      <Router>
        <Routes>
        <Route path="/" element={<AdminNavbar/>}/>
        </Routes>
      </Router>

        <Routes>
        <Route path="/adminshop" element={<AdNav/>}/>
        </Routes>
    </div>
  );
}

export default App;
